chrome.tabs.onActivated.addListener((info) => {
  activeInfo.tabId = info.tabId
  activeInfo.windowId = info.windowId
  storeData()
})

chrome.runtime.onMessage.addListener(e => {
  if (e.type === 'save') requestSync(e)
  if (e.type === 'unload') storeData(e)
})


